import React from "react";

function NavBar() {
    return (
        <nav>
            <label class="logo">Stevens Lost & Found Tool</label>
            <ul>
              <li><a class="navb" href="#">Home</a></li>
              <li><a class="navb" href="#">Report Lost Item</a></li>
              <li><a class="navb" href="#">Find an Item</a></li>
              <li><a class="navb" href="#">About</a></li>
            </ul>
        </nav>
    )
}

export default NavBar
